import { TodoFormProps } from "../types/types";

const TodoForm: React.FC<TodoFormProps> = () => {
  return (
    <form
      onSubmit={(e) => {
        e.preventDefault();
      }}
      className="todo-form"
    >
      <input placeholder="Task" />
      <button>Add</button>
    </form>
  );
};

export default TodoForm;
